class User {
	constructor() {
		this.loggedIn = false;
		this.login = this.login.bind(this);
		this.logout = this.logout.bind(this);
		this.isOnline = this.isOnline.bind(this);
	}
	isOnline() {
		return this.loggedIn;
	}
	login() {
		this.loggedIn = true;
	}
	logout() {
		this.loggedIn = false;
	}
}
export default User;
